import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { User } from '../models/User';

@Component({
  selector: 'app-admin',
  templateUrl: './admin.component.html',
  styleUrls: ['./admin.component.css']
})
export class AdminComponent implements OnInit{

  constructor(private router: Router)
  {

  }

  ngOnInit(): void {
    let temp = localStorage.getItem("user")
    if(temp)
    {
      this.admin = JSON.parse(temp);

      if (this.admin.type != "admin")
      {
        localStorage.removeItem("user")
        this.router.navigate([""]);
      }
    }
    else
    {
      this.router.navigate([""]);
    }
  }

  page: number = 1
  users: User[] = []
  admin: User = new User()

  navigateTo(newPage: number)
  {
    this.page = newPage
  }

  logout()
  {
    localStorage.removeItem("user")
    localStorage.removeItem("admin")
    this.router.navigate([""])
  }
}
<nav class="navbar navbar-expand-lg navbar-dark">
    <div class="container">
      <a class="navbar-brand" href="#">Kutak dobre hrane</a>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>
      <div class="collapse navbar-collapse" id="navbarNav">
        <ul class="navbar-nav ml-auto">
          <li class="nav-item">
            <a class="nav-link" (click)="navigateTo(1)">User List</a>
          </li>

          <li class="nav-item">
            <a class="nav-link" (click)="navigateTo(2)">Restaurant List</a>
          </li>

          <li class="nav-item">
            <a class="nav-link" (click)="navigateTo(3)">User Requests</a>
          </li>

          <li class="nav-item">
            <a class="nav-link" (click)="navigateTo(4)">Add Restaurant</a>
          </li>

          <li class="nav-item">
            <a class="nav-link" (click)="navigateTo(5)">Add Waiter</a>
          </li>

          <li class="nav-item">
            <a class="nav-link" (click)="logout()">Log out</a>
          </li>
        </ul>
      </div>
    </div>
</nav>

<div class="container">

    <div *ngIf="page == 1">
        <table>
            <tr *ngFor="let user of users">
                <td>{{umetnina.naziv}}</td>
                <td>{{umetnina.ponuda}}</td>
                <input type="number" value="umetnina.novaPonuda" [(ngModel)] = "umetnina.novaPonuda">
                <button (click)="ponudi(aukcija, umetnina, umetnina.novaPonuda)">Ponudi</button>
            </tr>
        </table>
        <br>
    </div>

</div>
